class Counters {
	reset() {
		const keys = Object.keys(this);
		for (let i = 0; i < keys.length; i++) {
			const key = keys[i];
			this[key] = 0;
		}
	}

	inc(key) {
		if (!this[key]) {
			this[key] = 1;
		} else {
			this[key] = this[key] + 1;
		}
	}

	print() {
		const keys = Object.keys(this);
		for (let i = 0; i < keys.length; i++) {
			const key = keys[i];
			const v = this[key];
			console.log(`${key}: ${v}`);
		}
	}
}

export const counters = new Counters();

